0000017d-5ce4-7c61-c761-76e576ba0000	# What is TaxGig? \n TaxGig is a marketplace for tax related services. Instead of wasting thousands of hours attempting to do it yourself, TaxGig offers to prepare them quickly, correctly and at a fair price by finding your perfect match from our pool of verified professionals. \n\n    \n 1. Answer simple questions and get a price upfront. \n\n    \n 2. Whether you choose our pre-selected Pro or decide to find one on your own - we guarantee that you will be working with verified professionals who suit your needs. \n\n    \n 3. Upload all necessary documents that you need and your Pro suggests.  \n\n    \n 4. Relax and enjoy your time, while your Pro does the rest. \n\n    	0000017d-5ce4-7c4d-c761-76e576ba0000	What is TaxGig?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7c68-c761-76e576ba0000	# My taxes are fairly simple. Should I use TaxGig? \n TaxGig’s Pros have a variety of skills and are capable of dealing with both simple and complicated tax situations. \n\n\n They can prepare your tax documents, help with tax planning and file tax returns on your behalf. Furthermore, if you select a licensed Pro (CPA, EA, ATTY), they are eligible to represent you in the IRS if any questions about your tax return arise. \n\n\n Tax Pros can help you avoid mistakes when dealing with tax changes. If you qualify for itemized deductions or have a small business on the side, a licensed professional can help you understand the new TaxCuts and Jobs Act and its effect on you. \n\n\n Even though you want to apply for as many deductions as possible, you don’t want to trigger an audit from the IRS if your eligibility is questionable for some of them. Child and Dependent Tax Credit is among the most efficient tools to reduce your tax liability, and our Pros will help you identify whether you qualify or not. \n\n\n Due to the competitive nature of our platform, the average service price is lower than the one on the market. You are free to find your perfect Pro from our pool of verified tax professionals or go along with a TaxGig Hero - our pre-selected Pros who are the best on the platform. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	My taxes are fairly simple. Should I use TaxGig?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7c73-c761-76e576ba0000	# I am a business owner. Can TaxGig help me? \n The best business requires the best help. Whether you just started a new business or operating one for years now, one thing is for sure - you need to have a good trusted accountant by your side. \n\n\n First of all, business taxes are very different from personal ones. Depending on the size of the business and/or if you sold your products in multiple states or even countries, taxes will only get more complicated. Our Pros will help you avoid paying extra dollars and suggest different strategies to lower your business’ tax liability for the years to come, especially after the adoption of  the Tax Cuts and Jobs Act. \n\n\n Second, operating a business requires a lot of day-to-day work and record keeping. Having an in house accountant adds a lot of extra costs to your business. Bookkeeping, payroll, sales tax - outsourcing it to one of our Pros will save you money and bring additional benefits. \n\n\n We match you with Pros who have the best skills and knowledge to help your business prosper. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	I am a business owner. Can TaxGig help me?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7c7e-c761-76e576ba0000	# Non-resident alien, International student or an American working abroad? \n These types of taxes are complicated and hard. If you just moved to the US for work or found a paid internship/side job as a student, by the end of the year you’ll have to deal with this scary word 'taxes' for the first time. The US tax code is much more complicated than in the rest of the world, but it provides a lot of tax deduction and tax credit opportunities. Having to deal with it by yourself will bring more stress and the possibility of making a mistake may result in undesirable problems with the IRS. Existing do-it-yourself software does not provide enough help in this situation. Our Pros will take away your pain and file taxes on your behalf, which will save you money and time. \n\n\n If you earned income abroad at some point of the year or moved to another country for work, you are still obliged to pay taxes and report your income to the IRS as an American citizen. Our Pros will prevent you from paying extra and will ease the tax return preparation. \n\n\n Stop worrying about getting everything right and let our tax Pros help you out. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Non-resident alien, International student or an American working abroad?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7c8a-c761-76e576ba0000	# Self-employed, Freelancer, Uber/Lyft driver or Trucker? \n When you have a lot of things going on in your life, the smartest choice is to hand your taxes to a Pro. Working for yourself allows you to be your own boss, working with whom you want and where you want. However, such independence also comes with a certain price. Whether you have rental property, earned income in different states and/or used your vehicle to perform work-related activities - our Pros will help identify and calculate all the possible deductions to reduce your tax liability and ease the tax filing process overall. \n\n\n Our pool of experts will deal with your taxes and bookkeeping to let you get back to doing your business. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Self-employed, Freelancer, Uber/Lyft driver or Trucker?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7c95-c761-76e576ba0000	# Who are the Pros? \n Our professionals can only get access through verification of their identity and PTIN. We do that via Blockscore (that verifies SSN and performs a background screening on Criminal Records and Sexual Assaults) and via IRS database, that has lists of people granted with permission to prepare taxes and whether or not having certified credentials. \n\n\n Our Pros include CPAs, EAs, Attorneys and those who were granted permission to prepare taxes via IRS (PTIN holders). \n\n\n All qualifications will be visible in each Pro’s profile when browsing. Our TaxGig Heroes are the Pros who are certified with CPA, EA or Attorney credentials and have successfully fulfilled the requirements to become a TaxGig Hero. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Who are the Pros?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7ca0-c761-76e576ba0000	# How it works? \n TaxGig values your time the most. Instead of wasting thousands of hours attempting to do it yourself, TaxGig offers to delegate your most sensitive and painful part of life to our pool of verified professionals. \n\n\n All you need to do is to answer simple questions, select a Pro and upload all necessary documents. Your Pro will find all possible deductions and suggest on how to get a maximum refund. You can enjoy your life and do whatever you need to do, while your Pro will do the job for you. \n\n\n  1. Answer simple questions and get a price upfront. \n\n\n 2. Whether you choose our pre-selected Pro or decide to find one on your own - we guarantee that you will be working with verified professionals who suit your needs. \n\n\n 3. Upload all necessary documents that you need and your Pro suggests. \n\n\n 4. Relax and enjoy your time, while your Pro will do the rest. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	How it works?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7cab-c761-76e576ba0000	# Is TaxGig free? \n TaxGig is absolutely FREE to join! TaxGig does not ask for any payment to get access to the platform. You can browse through the list of our professionals and see upfront estimates for your return for free. \n\n\n You will only be asked to add a card/bank account details and make a partial upfront payment when you start working with a Pro. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Is TaxGig free?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7ccc-c761-76e576ba0000	# State returns \n If you earned income in different states, you can select them in the questionnaire. If you earned income outside of the US, just indicate it as well. Our Pros have an experience in filing for all types of tax returns. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	State returns	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7cb6-c761-76e576ba0000	# Filing as a non-resident alien \n Did you just move to the US for work or study and the word 'taxes' sounds like something horrible? No need to worry! TaxGig is here to provide you with professionals experienced in preparing non-resident alien returns. Make sure to state that in the questionnaire to be matched with qualifying Pros. \n\n\n Don’t stress about taxes, let our Pros help you. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Filing as a non-resident alien	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7cc1-c761-76e576ba0000	# Filing for multiple years \n Not a problem! Just indicate the years needed filing at the end of the questionnaire. If different years need to have a different filing status, it is best to create separate tax return projects. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Filing for multiple years	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7d47-c761-76e576ba0000	# How does TaxGig differ from do-it-yourself software? \n Instead of wasting thousands of hours attempting to do it yourself, TaxGig offers a service to prepare taxes quickly, correctly and at a fair price by finding you a perfect match from our pool of verified professionals. \n\n\n You no longer have to stress about getting everything right and on time. Our Pros are here to help with preparing and filing your return, so you can relax and go back to whatever you’ve been doing. \n\n\n Due to the competitive nature of our product, the average price for tax preparation services is way lower than on the market. You decide with whom to work and on what terms. We do not dictate the price like H&R Block, Intuit and others. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	How does TaxGig differ from do-it-yourself software?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7d52-c761-76e576ba0000	# When do I get a quote? \n All you need to do is answer a simple questionnaire. At the last step, you will be provided with a choice - to work with our pre-selected Pro or find the one on your own. \n\n\n For an **Instant Match**, the price will be available right away. If you want to find one by yourself, we will show you the average prices for Pros’ services based on what you answered. In this case, the final quote will be sent by your Pro before the cooperation between you starts. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	When do I get a quote?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7def-c761-76e576ba0000	# What is my relationship with my Pro? \n Your tax Pro is an independent third party who has been vetted and background checked by TaxGig. Furthermore, if your Pro is a CPA, EA or Attorney, we will verify their credentials as well. Any Pro is free to engage or reject the work within TaxGig on their own and at absolute discretion within their own preferred schedule. When you start your engagement with a Pro, you will share all of the relevant information with him/her regarding your tax activity via chat and **Documents** section. When the job is done, you will rate your Pro based on our rating system. It helps us ensure the high quality of every Pro on the platform.  \n\n\n We understand that finding a proficient tax professional is similar to finding the right personal doctor - it is very hard and intimate. Therefore, we built this platform to ease the search for a perfect match. Even though we prohibit external communication outside of the TaxGig platform to ensure the security of the data shared and quality of delivered professional service, you are encouraged to work with the same Pro on your new projects. This recurring engagement will bring additional benefits for both parties, like discounts and lower commission. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	What is my relationship with my Pro?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7dfa-c761-76e576ba0000	# What if I'm not happy with the service? \n If you are not happy with the service, you can cancel it at any time. However, please remember the penalties stated in our cancellation policy. We have created standardized rules and procedures to ensure that both parties are treated properly during any engagement within the platform. If negligence is involved, then Pros will not get paid for the work. \n\n\n If any issues arise before, during or after your engagement with a Pro, be sure to notify us via email at support@taxgig.com, so we can resolve the matter together. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	What if I'm not happy with the service?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7eb7-c761-76e576ba0000	# How do I get matched with clients? \n TaxGig uses an intelligent algorithm that shows the clients based on the information provided and vice versa. \n\n\n First, you need to select what services you provide and identify specific areas and preferences. Then, identify your pricing for the selected fields, as well as for standardized add ons, such as price for additional filing years or states. Other parameters, such as spoken languages, area expertise, your rating and credentials will also affect the matching outcome. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	How do I get matched with clients?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7ec2-c761-76e576ba0000	 # How much does it cost? \n TaxGig is absolutely FREE to join! You can set any price you want for your service and modify it, if needed, when cooperating with the client. TaxGig has a fixed 20% commission fee, which is deducted only when the job is successfully finished. It is used to pay the third party integrations’ fee and improve the performance of the platform. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	How much does it cost?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7f26-c761-76e576ba0000	# How to become a TaxGig Hero? \n You have to meet and maintain our requirements. You have to successfully finish 5+ jobs via platform, maintain an average 4.0 rating or higher and have a professional license, such as EA (Enrolled Agent), CPA (Certified Public Accountant) or ATTY (Attorney).  If your license expires, you will have two weeks to update your information. If your rating drops below the required minimum and/or you lose your professional license, TaxGig Hero function will be disabled. You can always restore it when all the requirements are fulfilled again. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	How to become a TaxGig Hero?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7cd7-c761-76e576ba0000	# Can I have multiple tax returns in progress? \n Yes! You can have as many as you require. Business and Individual returns go separately, unless you are a sole proprietor - then it will go along with the Individual form. Furthermore, you can have separate individual returns, if different years require different filing status. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	 Can I have multiple tax returns in progress?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7d74-c761-76e576ba0000	# What if I want to cancel my project and terminate the cooperation with my Pro? \n You may cancel your project at any time by pressing the **Cancel** button while in the Open **Project** screen. Please be aware of these rules, if you decide to cancel: \n\n* In the first 2 hours after you have been assigned with a Pro to work on your project (when project is Assigned) - your money will be returned with **no penalty** (only includes a Stripe fee).\n* After 2 hours and before the Pro uploaded any documents to a Final document section - you will have to pay **35% of the quote** as a penalty.\n* After a Pro uploaded any documents to a Final document section - you will have to pay **75% of the quote** as a penalty but can **leave a review** for the Pro.\n\n If you were not satisfied with service after the deal is already closed, please contact our team via support@taxgig.com to resolve the matter together. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	What if I want to cancel my project and terminate the cooperation with my Pro?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7e69-c761-76e576ba0000	# When will my project be completed? \n It depends on the complexity of your project and whether all the information was provided at the beginning of the engagement or not.  \n\n\n Simple tax returns may be prepared within a couple of hours, whereas more complicated ones or a monthly bookkeeping may require up to a week. Please ensure that you fully describe your tax situation and/or required service right away to your Pro and provide all the necessary documentation. The sooner it is done, the faster your project will be prepared. \n\n\n If you requested a tax return, do not forget to electronically sign your final document for a Pro to e-file it on your behalf. If you do not do so in 48 hours after your Pro uploaded the final document, the deal will be closed, and you will have to file it on your own. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	When will my project be completed?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7ed8-c761-76e576ba0000	# What is my relationship with TaxGig? \n TaxGig does not employ Pros that work on the platform. You are your own boss and regarded as a sole proprietor. However, professional conduct, up to date credentials/PTIN and minimum rating are required to maintain access to the platform and its pool of clients. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	What is my relationship with TaxGig?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7ce2-c761-76e576ba0000	# Itemizing deductions \n We encourage you to communicate with your Pro when matched. The more information they are provided with, the better their service is going to be. If you feel that you can benefit from itemizing your deductions, let your Pro know that in the questionnaire and during the communication. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Itemizing deductions	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7d8a-c761-76e576ba0000	# What if I answer a question incorrectly? \n You can always cancel your project before selecting a Pro. At this stage, you can edit all the answers and information related to it. When done, simply renew the project. Please note that quotes will change based on the information changed. \n\n\n If you have already started working with a Pro, please notify your Pro about the mistake. Your Pro will recalculate the quote for you. If it requires additional payment, simply accept add-ons that your Pro sends you. \n\n\n If the new quote is lower than the original one, please contact support@taxgig.com to resolve the matter. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	What if I answer a question incorrectly?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7e74-c761-76e576ba0000	# Can I get a tax extension via TaxGig? \n Yes, you can. Simply mention it in the **Additional Comments section** at the end of the questionnaire for your Pro to understand that you require a tax extension form when deciding to work on your tax return. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Can I get a tax extension via TaxGig?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7ee3-c761-76e576ba0000	# What are my responsibilities? \n TaxGig expects Pros are obliged to maintain a professional conduct while working with clients, as well as keep their personal information secured and not shared with any third party. Furthermore, make sure to keep your credentials and PTIN up to date with the IRS and their open database, which can be found at PTIN Information and the Freedom of Information Act. Moreover, TaxGig has a minimum requirement of an average 3.5 or above rating based on 5+ jobs to prevent fraud and maintain the high quality service provided via the platform. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	What are my responsibilities?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7cf9-c761-76e576ba0000	# Business tax returns \n Regardless of your business size, TaxGig has Pros that can help with any requirement. Just make sure to select the type of entity needed filing and specify necessary details in the questionnaire. We will match you with the best qualifying Pros for your return. Furthermore, we can assist you with bookkeeping and sales tax as well, if required - just create another project for the selected service. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Business tax returns	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7d95-c761-76e576ba0000	# How is the quote generated? \n Each Pro has a price list for each service. The quote is generated based on the responses you provide. However, additional fees may apply if new information and requirements come up during your cooperation with a Pro. \n\n\n If you chose to work with **TaxGig Hero**, then your quote will be shown right away. If you want to find a Pro by yourself, we will show average prices for Pros’ services based on what you answered. In this case, the final quote will be sent by your Pro before the cooperation between you starts. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	How is the quote generated?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7e7f-c761-76e576ba0000	# How TaxGig works? \n TaxGig is a marketplace for tax related services. Stop wasting hours on searching for new clients via your family, friends, LinkedIn or by using online advertising -  on TaxGig clients will be looking for YOU. With the help of intelligent algorithms, you will be matched only with people who require your particular expertise - the process is easy and fast. \n\n\n Furthermore, our platform offers you a transparent competition and interaction with clients, as well as an individual approach to each of your needs. You don’t have to work for somebody else no more - with TaxGig you can be your own boss, working whenever you want and with whom you want.  This is a list of super easy steps to get you started: \n\n\n 1. Fill in your personal and background information to set up your profile. \n\n\n 2. Identify the services you provide and at what price. \n\n\n 3. Explore job opportunities or get instantly matched to clients by enabling our premium feature 'TaxGig Hero'. \n\n\n 4. Identify the amount of work required and send a quote. \n\n\n 5. Start working and earn money! \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	How TaxGig works?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7eee-c761-76e576ba0000	\n Here is the illustration of how TaxGig is superior to other market competitors: \n\n\n <img width=100% src='/images/faq/competitive_advantage.png' /> \n	0000017d-5ce4-7c51-c761-76e576ba0000	How TaxGig differs from other platforms?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7d04-c761-76e576ba0000	# Requesting services not listed on TaxGig \n TaxGig works every day to improve our platform and add new services. As of now, we do not have occupancy tax assistance, quarterly estimates or incorporation services yet. However, you can always ask your Pro if he/she provides those. Your Pro will use add-ons to include additional service charge to your quote. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Requesting services not listed on TaxGig	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7dac-c761-76e576ba0000	# Will my quote change? \n Your quote may be changed only if the information provided during the questionnaire was not complete or you require additional services not stated initially.  Your Pro will recalculate the quote. \n\n\n If it requires extra payment, your Pro will send you add-ons. You can accept or decline them. \n\n\n Please remember that if you don't come to a mutual agreement, TaxGig may intervene upon request as a mediator to resolve a dispute. \n\n\n If the new quote is lower than the original one, please contact support@taxgig.com to resolve the matter. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Will my quote change?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7d31-c761-76e576ba0000	# Can I use TaxGig outside the US? \n Yes, you certainly can access the service outside of the US. TaxGig is here to help you fulfill your obligations with the IRS, regardless of your current location. \n\n\n Filling from abroad may be difficult and uncomfortable, that’s why we have created this platform to ensure easy and fast communication between you and your tax professional. Just identify your status of filling from abroad via questionnaire when creating a project. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Can I use TaxGig outside the US?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7e8b-c761-76e576ba0000	# Why join as a Pro? \n Tired of working for somebody else and/or wasting hours on searching for new clients via your family, friends, LinkedIn or by using online advertising? TaxGig offers you to become your own boss, work when you want and with whom you want. Here is the list of a few other reasons to join: \n\n* Forget about local boundaries - prepare tax returns and/or provide bookkeeping for clients located in other states.\n* Don't Waste Time on Search - get instantly matched to the client based on your set of skills.\n* Earn more - determine your own price for the service.\n* Advanced scam protection -  deal only with real people and their needs.\n* Intelligent analysis - know how you perform.\n* Secure payment system - receive payment protection and guaranties for the work you provide.\n* Instant verification - we use open IRS databases and Blockscore to momentarily verify your personal information and credentials.\n	0000017d-5ce4-7c51-c761-76e576ba0000	Why join as a Pro?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7ef9-c761-76e576ba0000	# Cancelation Policy\n\n To secure the interaction between clients and Pros and ensure the fairness of the work performed, we have created the following cancellation policy: \n\n\n 1. If you cancelled the job in the first 2 hours and your client did not upload any document, there will be no penalty as well as no money received \n\n\n 2. If you cancel after the first 2 hours since client went in stage Current Client, you will not receive any money and your client will be able to leave you a rating \n\n\n 3. When more than 24 hours have passed since your client went in stage Current Client and/or you have uploaded the Final Document, the cancellation button is disabled. If you have any issues at that point, please contact support@taxgig.com right away. \n\n\n 4. If your client cancels the job within the first 2 hours and NOT uploaded any documents, there will be no penalty for any of you and no payout collected. \n\n\n 5. If your client cancels the job after 2 passes since he/she went in stage Current Client, he/she will receive a 35% penalty fee that will be paid out to your account. \n\n\n 6. If your client cancels the job after you have prepared and uploaded the Final Document, the 75% fee will apply to him/her that will be paid out to your account. However, the client will still be able to leave you a rating. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	Cancelation policy	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7d1a-c761-76e576ba0000	# Can I contact my Pro outside of TaxGig? \n Unfortunately, this would be a violation of our Terms of Usage. TaxGig can guarantee the security of your documents and payment only within the platform. We use encryption for shared files and have specific policies to prevent fraud and identity theft. \n\n\n If you choose to take your return outside of the TaxGig, it won’t be secure and the following penalties will apply. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Can I contact my Pro outside of TaxGig?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7db7-c761-76e576ba0000	# Can the fee be taken out of my tax refund? \n Unfortunately, we are not there yet and cannot deduct the fees from your tax refunds. We are always working on improving TaxGig’s experience and will resolve this issue in the nearest future. \n\n\n However, the IRS has significantly improved its e-file process so that you can expect electronically filed returns within 5 to 10 days after the submission. Most refunds are processed and returned within 21 calendar days.  \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Can the fee be taken out of my tax refund?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7e96-c761-76e576ba0000	# Who can become a Pro? What are the minimum requirements? \n TaxGig primarily deals with tax preparation as well as with other tax related services. Therefore, there is a minimum requirement of holding an active PTIN. If you are a licensed professional, it will give you an advantage over other Pros and will provide an opportunity to apply for our premium feature - TaxGig Hero. Once verified, your credential(-s) will be displayed on your profile. As of now, we exclusively operate in the US. Therefore, only local credentials and verification documents will be accepted. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	Who can become a Pro? What are the minimum requirements?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7f05-c761-76e576ba0000	# How do I accept payments? \n Each Pro is automatically created with a Stripe connected account that enables receiving payments and enables a payout to your identified method. Stripe has a scheduled payout once a week. You will be able to see the transaction history and pending balance via your Profile. You are free to add up to 10 payout methods that include Debit cards and/or Bank accounts. When sending an offer to your client or automatically matching via a TaxGig Hero function, you will be asked to select a preferred payout method for the selected job. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	How do I accept payments?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7d25-c761-76e576ba0000	#Can I choose the same Pro to work on my next project? \n Yes, you can. TaxGig knows that finding a right tax professional is like finding a right personal doctor. The candidate must perfectly match your needs and know all the details about you. Therefore, helped by AI, we pre-select the best matching Pros for you and show other candidates who might be of great fit. Our goal is to help you find the perfect tax professional. \n\n\n If you like the services provided, you can continue working with the same Pro. To do so, go to your project that was closed with the preferred Pro and press **Create Project** button. It will be automatically sent to your Pro for him/her to send a new quote for the service.  \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Can I choose the same Pro to work on my next project?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7dcd-c761-76e576ba0000	# Why was my credit card just billed for a few dollars? \n This is a standard procedure to verify the new payment method. This money will be automatically returned when the card/bank account is approved. \n\n\n If your project is Assigned (meaning you already matched with a Pro), we charge a fixed 35% fee of the quote which is put into an escrow account. If you wish to cancel the project, please read our cancellation policy carefully first. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Why was my credit card just billed for a few dollars?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7ea1-c761-76e576ba0000	# What is the verification process? \n Clients will be sharing their most private information with you. Therefore, we check your information via the SSA and IRS Directory of PTIN holders by using Blockscore as a third party service and IRS’ open database. Make sure to enter your information correctly to proceed with the registration. **We do not store your SSN**. \n\n\n Furthermore, to secure payments and guarantee the payout, we create a Stripe connected account for each Pro. Stripe requires your personal information, such as First Name, Last Name and SSN (last four digits). After successfully passing the verification, the unlimited payouts will be automatically enabled. Make sure to read Stripe’s Terms and Conditions carefully before proceeding. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	What is the verification process?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7f10-c761-76e576ba0000	# How often do I get paid? \n Stripe has a scheduled payout once a week. You will be able to see the transaction history and pending balance via your Profile. You are free to add up to 10 payout methods that include Debit cards and/or Bank accounts. You will be paid out the whole sum after your client goes to the stage Past. If the job is cancelled, the Cancellation policy may apply and only a partial sum will be paid out depending on the stage the incident occurred. Learn more via our Cancelation Policy. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	How often do I get paid?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7de4-c761-76e576ba0000	# How is my project routed to the right Pro? \n We ask Pros to describe their previous work experience and identify job preferences, so we can help our algorithms to match you perfectly. Even if you find a Pro on your own rather than using the one we have pre-selected, the Pros shown will still match the service you require. This will help you to find your Pro much faster and still get the perfect match you seek. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	How is my project routed to the right Pro?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7eac-c761-76e576ba0000	# What services can I provide? \n TaxGig is a marketplace for tax related services. As of now, we have prepared customized questionnaires for services, such as **Individual Tax Return**, **Business Tax Return**, **Bookkeeping** and **Sales Tax**. Other services, such as Tax Consultation, Quarterly Estimates, Financial Planning and Tax Extension will be enabled in the nearest future. \n\n\n If you can provide additional services not listed on the platform, feel free to notify your client and increase the final quote via an Add-On function. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	What services can I provide?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7f1b-c761-76e576ba0000	# What is a TaxGig Hero? \n TaxGig Hero is a premium function we offer to the best performing Pros. Becoming one will allow you to have more clients and look more professional in the eyes of your potential customers. \n\n### Here is the list of perks you automatically get \n\n\n * Increased number of open jobs - you can have up to three more clients simultaneously via Instant match. \n\n\n * TaxGig Hero badge - let others know that you are the best at your job. \n\n\n * Instant match - no more waiting for the response. Now, you will be instantly matched to new clients who match your expertise. Make sure to keep the button ON. \n\n# The Deal\n\n We will instantly calculate your potential earnings based on the client's answers. You can always use add-ons, if you feel that the price needs to be adjusted. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	What is a TaxGig Hero?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7d5d-c761-76e576ba0000	# Do I need to pay upfront? \n You are free to use and browse through the platform. You will only have to make a payment when engaging with a Pro. We will deduct 35% of the quote and put it into an escrow account. No worries, your payment will only be released to a Pro when the deal is closed. \n\n\n We use an escrow method to prevent scam and ensure the safety of the transaction to prevent any disputes between you and your Pro. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	Do I need to pay upfront?	2021-11-26 15:36:57	2021-11-26 15:36:57
0000017d-5ce4-7e10-c761-76e576ba0000	# How long should I wait to get a match with a Pro? \n If you go with **TaxGig Hero** when choosing a Pro, it will only be a matter of seconds. If a matching Tax Hero is online, you will connect momentarily. However, if your project is submitted outside the regular working hours (like at night or early morning EST), it may take a minute or two to find you a perfect match and get your Pro online. \n\n\n If you found a Pro on your own, most professionals are people with similar schedules to yours. Pros may not respond right away at late nights or early mornings. In the rest of the time, they usually respond quickly. \n\n	0000017d-5ce4-7c4d-c761-76e576ba0000	How long should I wait to get a match with a Pro?	2021-11-26 15:36:58	2021-11-26 15:36:58
0000017d-5ce4-7ecd-c761-76e576ba0000	# How much can I earn? \n TaxGig does not set prices for the services, except when matched automatically as a TaxGig Hero. However, even then you can adjust it via Add ons. If searching for clients manually, just send an offer to your client, which you can still modify later via add ons. TaxGig has a fixed 20% commission fee, which is deducted only when job is successfully finished. It is used to pay the third party integrations’ fee and improve the performance of the platform. \n\n	0000017d-5ce4-7c51-c761-76e576ba0000	How much can I earn?	2021-11-26 15:36:58	2021-11-26 15:36:58
